import ReactDOM from 'react-dom/client';
import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import { useParams, useLocation } from 'react-router-dom';

const data = [
  { filename: "cuhk-2013.jpg", year: 2013, remarks: "Sunset over CUHK" },
  { filename: "cuhk-2017.jpg", year: 2017, remarks: "Bird's-eye view of CUHK" },
  { filename: "sci-2013.jpg", year: 2013, remarks: "The CUHK Emblem" },
  { filename: "shb-2013.jpg", year: 2013, remarks: "The Engineering Buildings" },
  { filename: "stream-2009.jpg", year: 2009, remarks: "Nature hidden in the campus" },
];

class App extends React.Component {
  render() {
    return (
      <>
      <BrowserRouter>
        <div>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            {/*  */}
            <li>
              <Link to="/file/fileA">file A</Link>
            </li>
            <li>
              <Link to="/file/fileB">file B</Link>
            </li>
            <li>
              <Link to="/file/fileC">file C</Link>
            </li>
            <li>
              <Link to="/wrongFile/wrongFile">This is a wrong link</Link>
            </li>
            {/*  */}
          </ul>
        </div>

        <hr />

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          {/*  */}
          <Route path="/file/:id" element={<File />} />
          <Route path="*" element={<NoMatch />} />
          {/*  */}
        </Routes>
        </BrowserRouter>
        <Gallery />
      </>
    );
  }
}

class Home extends React.Component {
  render() {
    return <h2>Home</h2>;
  }
}

class About extends React.Component {
  render() {
    return <h2>About</h2>;
  }
}

class Gallery extends React.Component {
  render() {
    return (
      <main className="container">
        {data.map((file, index) => <FileCard i={index} key={index} />)}
      </main>
    );
  }
}



// 
function File() {
  let { id } = useParams();
  return (
    <div>
      <h3> ID: {id} </h3>
    </div>
  );
}

function NoMatch() {
  let location = useLocation();
  return (
    <div>
      <h3>
        No Match for <code>{location.pathname}</code>
      </h3>
    </div>
  );
}
// 

const root = ReactDOM.createRoot(document.querySelector('#app'));
root.render(<App />);
